import React from 'react';
import Sidebar from './Sidebar';

const McTheProfVideos = () => {
	return (
		<div className="flex">
			<div className="mr4 nb3">
	        	<h1 className="baskerville bb b--moon-gray"><i>MCTheProfessor.GOV Videos</i></h1>
	        	<p><a href="https://www.youtube.com/watch?v=ANbU74tg0MY">MCtheProfessor.GOV - Lecture #1: Problematizing the National History Survey</a></p>
		    	<p><a href="https://www.youtube.com/watch?v=StAVct_OX_k">MCtheProfessor.GOV - Lecture #2: Civil War Memory: Contestations of the Past & Politics Today</a></p>
		    </div>
	         <Sidebar />
         </div>
   	);
};

export default McTheProfVideos;
